wikitext.*:
本模板用来把一位阿拉伯数字转换成对应的小写中文数字。

==参数==
* 位置参数1：数字。

==例子==
*<code><nowiki>{{User:Hydrofluorina/一位中文数字|0}}</nowiki></code> → {{User:Hydrofluorina/一位中文数字|0}}
*<code><nowiki>{{User:Hydrofluorina/一位中文数字|9}}</nowiki></code> → {{User:Hydrofluorina/一位中文数字|9}}
*<code><nowiki>{{User:Hydrofluorina/一位中文数字|12}}</nowiki></code> → {{User:Hydrofluorina/一位中文数字|12}}
